import React from "react";
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';


const Todo = ({text}) => {
    return(
        <div className="item-div">
            <li className="todo-item">{text}</li>
            <Button variant="danger">-</Button>
            
            
        </div>
    );
};

export default Todo;
